import React from 'react';

function Projects() {
  const projects = [
    { id: 1, title: 'Projeto 1', description: 'Descrição breve do projeto incrível.' },
    { id: 2, title: 'Projeto 2', description: 'Outro projeto inovador.' },
    { id: 3, title: 'Projeto 3', description: 'Mais um projeto que merece destaque.' }
  ];

  return (
    <section id="projects" className="projects container">
      {projects.map((project) => (
        <div key={project.id} className="project-card">
          <h3>{project.title}</h3>
          <p>{project.description}</p>
        </div>
      ))}
    </section>
  );
}

export default Projects;
